    update(city) {
        if (city) {
            city => this.updateWeather(city);

        }
    }

    async updateWeather(city) {
        let data = null;

        try {
            data = await this.getWeather(city);
        } catch (e) {
            data = this.getErrorData();
        }

        this.populate(data);

    }

    async getWeather(city) {
        let appId = '9f2a6791591faa35ae205c04b592baef';
        if (localStorage.getItem('appID')) {
          appId = JSON.parse(localStorage.getItem('appId'));
        }
        let endpoint = `https://api.openweathermap.org/data/2.5/weather?q=${city}&appid=${appId}&units=metric`;

        let response = await fetch(endpoint);

        return await response.json();
    }

    getErrorData() {
        return {
                main: {
                    temp: 0,
                },
                weather: [
                    {
                        id: 0,
                        description: `Please connect to internet to fetch the latest weather information`
                    }
                ],
                wind: [
                  {
                    deg: 0
                  }
                ],
                name: '--'
            };
    }

    populate(data) {

        this.temperatureValue = Math.round(data.main.temp);
        this.location = this.formatLocation(data.name);
        this.description = data.weather[0].description;
        this.weatherIcon = this.getWeatherIcon(data.weather[0].icon);
        this.sunrise = data.sys.sunrise;
        this.sunset = data.sys.sunset;
        this.wind = data.wind.deg;

    }


    formatLocation(city,) {
        if (city === null) {
            return '';
        }
        return city;
    }


